    properties: {role: null, align: left, tooltip: '', enable_slots: true, border: '',
      foreground: '', visible: true, font_size: null, content: "\n\nI.   Identification\n\
        \n \n\n1.     Th\xe8me/sujet : Niveau de l'ammonite\n\n2.     Site : Jebel\
        \ Harraba\n\n3.      Lieu : Jebel Harraba 35.98873, 8.34510\n\n \n\n**II.\
        \  Conseils et informations pratiques** :\n\n \n\n- Statut de la terre : Propri\xe9\
        t\xe9 de l'Etat\n\n- Acc\xe8s : facile par une route carrossable de 1 km partant\
        \ de la route J. Harraba-J.Slata (fig.2).\n\n- Point de d\xe9part vers le\
        \ site : Circuit du Kef vers J. Harraba (fig.1). \n\n \n\n \n\n- Distance\
        \ : environ 43 km\n\n- Absence de signalisation\n\n- Sentiers d'acc\xe8s au\
        \ site non am\xe9nag\xe9s\n\n- Mise en place de panneaux interdisant la collecte\
        \ de fossiles. \n\n \n\n \n\n**III. Description du site\n\n \n\n1. Int\xe9\
        r\xeat pour la visite du site** **G\xe9ologique\n\n \n\n**G\xe9ologique**\n\
        \n \n\nLe site en question est situ\xe9 au nord du Jebel Harraba. On y acc\xe8\
        de par une piste depuis la route reliant J. Harraba \xe0 J. Slata.\n\n \n\n\
        **Pal\xe9ontologiquement\nLe site \xe0 ammonites correspond \xe0 une couche\
        \ m\xe9trique de gr\xe8s rouge portant de nombreuses grandes empreintes d'ammonites\
        \ (photos). Le lit de gr\xe8s marque la transition entre l'Aptien sup\xe9\
        rieur (-108 Ma), repr\xe9sent\xe9 par des calcaires r\xe9cifaux, et l'Albien\
        \ (-108 \xe0 -96 Ma), repr\xe9sent\xe9 par une \xe9paisse s\xe9rie essentiellement\
        \ marneuse avec des intercalations calcaires en lits centim\xe9triques. \n\
        \nLe visiteur arrivant au niveau du banc se trouvera en fait devant un d\xe9\
        p\xf4t d'ammonites pyriteuses, de tailles et de formes diverses, ne pr\xe9\
        sentant aucune organisation mais dispos\xe9es p\xeale-m\xeale (photo). \n\n\
        On peut se permettre de ramasser quelques ammonites, mais il faut faire attention\
        \ \xe0 ne pas les ab\xeemer.\n\n**Pal\xe9og\xe9ographie**\n\n \n\nLes ammonites\
        \ sont des organismes marins apparus d\xe8s le D\xe9vonien (-419 \xe0 -359\
        \ Ma). \n\nElles ont disparu avec les dinosaures apr\xe8s la crise de la limite\
        \ Cr\xe9tac\xe9-Tertiaire (-65 Ma). \n\n \n\nPendant l'Aptien sup\xe9rieur\
        \ (-108 Ma), la r\xe9gion correspondait \xe0 un domaine de plate-forme peu\
        \ profonde, coup\xe9 par une s\xe9rie de hauts-fonds et de bassins. Des calcaires\
        \ r\xe9cifaux, riches en fossiles de divers organismes (rudistes, coraux,\
        \ orbitolines), se sont d\xe9pos\xe9s sous les zones \xe9lev\xe9es.  Vers\
        \ la fin de l'Aptien et le d\xe9but de l'Albien, le niveau de la mer s'\xe9\
        l\xe8ve, un processus connu sous le nom de transgression.Les d\xe9p\xf4ts\
        \ deviennent plus marneux, avec une faune d'eau profonde.\n\n \n\nLe niveau\
        \ de gr\xe8s \xe0 ammonites a \xe9t\xe9 d\xe9pos\xe9 pendant la transgression\
        \ marine. Les ammonites qui nageaient dans l'eau de mer sont tomb\xe9es au\
        \ fond apr\xe8s leur mort et ont \xe9t\xe9 m\xe9lang\xe9es aux s\xe9diments.C'est\
        \ pourquoi ces fossiles sont dispos\xe9s p\xeale-m\xeale dans le s\xe9diment\
        \ (photo). \n\n \n\n \n\n**IV. Pour en savoir plus** : \n\n \n\n**R\xe9f\xe9\
        rences bibliographiques**\n\n \n\nBurollet, P.F. 1956 : Contribution \xe0\
        \ l'\xe9tude stratigraphique\nde la Tunisie centrale.Ann. Mines G\xe9ol. (Tunis)\
        \ 18. - 1985 : Signification g\xe9ologique de l'Axe nord-sud. 1er Congr. nat.Sci.\
        \ Terre (Tunis, 1981).\n\nBolze, J., Burollet, P.F. & Castany, J. 1952 : Le\
        \ sillon\ntunisien.19\xe8me Congr. g\xe9ol. int. (Alger), Monogr. reg. 2\xe8\
        me S\xe9r : Tunisie - 5.\n\n\n\n", font: '', spacing_above: small, spacing_below: small,
      data: null, background: '', format: markdown}
